import './App.css';
import React from 'react';

import axios from 'axios';

export default class GamesList extends React.Component {
  state = {
    games: []
  }

  componentDidMount() {
    axios.get(`http://127.0.0.1:8000/socapi/`)
      .then(res => {
        const games = res.data;
        this.setState({ games });
      })
  }

  render() {
    return (
      <ul>
        { this.state.games.map(game => <li>{game.country}</li>)}
      </ul>
    )
  }
}
